DROP TABLE IF EXISTS `spell_power`;

CREATE TABLE `spell_power` (
  `Id` int unsigned NOT NULL DEFAULT '0',
  `ManaCost` int NOT NULL DEFAULT '0',
  `ManaCostPerLevel` int unsigned NOT NULL DEFAULT '0',
  `ManaCostPercentage` int NOT NULL DEFAULT '0',
  `ManaPerSecond` int unsigned NOT NULL DEFAULT '0',
  `ManaPerSecondPerLevel` int NOT NULL DEFAULT '0',
  `PowerDisplayId` int unsigned NOT NULL DEFAULT '0',
  `ManaCostPercentageFloat` float NOT NULL DEFAULT '0',
  PRIMARY KEY (`Id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

